(44, 24, 1, '{\"title\":\"Why my profile is not shown in website?\",\"description\":\"<p>After submitting full profile informatin it will be screening by customer care. Sometimes it may be at queue, after activation you will receive confirmation email and notification.<\\/p><p>For any queries, feel free to contact us.<\\/p>\"}', '2021-12-17 10:00:13', '2022-11-24 05:26:31'),
(45, 25, 1, '{\"title\":\"How to register at Matrimony?\",\"description\":\"To access the site properly, viewers must be needed to be registered as a member.The registration form has appeared with some fields such as First Name, Last Name, Phone\\/Email, Password etc. By clicking the \\u201cSign Up\\u201d button viewers will accept the terms &amp; conditions of the site.\"}', '2021-12-17 10:00:13', '2022-11-24 05:39:08'),
(47, 27, 1, '{\"title\":\"How to purchase a package by a member?\",\"description\":\"<ol><li>Login to the Member panel.<\\/li><li>Then go to the left navigation bar and click on the Packages &gt; Packages or from the top click on the Premium Plans.<\\/li><li>Choose your desired Package and click on the Purchase This Package button.<\\/li><li>Select your payment gateway.<\\/li><li>If you choose a manual payment method then insert Transaction ID, Payment proof, and Payment details.<\\/li><\\/ol>Finally, Click on the Confirm Button.\"}', '2021-12-17 10:00:13', '2022-11-24 05:41:42'),
