(230, 87, 1, '{\"title\":\"I forgot my Password. What should I do?\",\"description\":\"You can retrieve your Password by clicking on Forgot Password link in Sign In page and enter your E-mail ID. Your E-mail should be the one given in your profile.<br \\/>\"}', '2022-10-10 03:43:19', '2022-11-24 05:51:30'),
(231, 88, 1, '{\"title\":\"What is Auto Profile Match?\",\"description\":\"<p>Auto Profile Match is a feature that helps you define your ideal spouse and set your suitability criteria. With this feature you would receive information about members suiting your expectations regularly.<br \\/><\\/p>\"}', '2022-10-10 03:44:22', '2022-11-24 05:55:26'),
(232, 89, 1, '{\"title\":\"How do I ignore profiles?\",\"description\":\"<p>Login using your e-mail ID and \'Password.\'<\\/p><p><span>Go to Members page or do a search.<\\/span><\\/p><p>You can also Opt for viewing full profile.<\\/p><p>You will find options to ignore profile.<\\/p>\"}', '2022-10-10 03:44:39', '2022-11-24 05:58:42'),
(257, 90, 1, '{\"title\":\"How do I add my success story?\",\"description\":\"<p>If your marriage has been arranged through our service and you want to share your success story with us, then login to your account, goto Dashboard to add it onto our site. Your success story is a motivation to us as well as our members. So please do add your story and marriage photograph to our list of success stories.<br \\/><\\/p>\"}', '2022-11-24 06:01:27', '2022-11-24 06:02:04'),
(259, 91, 1, '{\"name\":\"Priya &amp; Rohit\",\"relation\":\"Self\",\"description\":\"<p><strong>Priya &amp; Rohit: A Match Made in Heaven<\\/strong>\\n<\\/p><p><em>\\\"We couldn\'t be happier! SPMO Matrimony connected us, and it felt like destiny from the start. The platform made it so easy to find someone who shared our values and goals. We\'re now planning our future together, and we owe it all to this amazing site!\\\"<\\/em><br \\/><\\/p>\"}', '2024-08-21 11:06:08', '2024-08-21 11:06:08'),
(260, 92, 1, '{\"name\":\"Anjali &amp; Karan\",\"relation\":\"Self\",\"description\":\"<p><strong>Anjali &amp; Karan: A Perfect Partnership<\\/strong><\\/p><p>\\n<em>\\\"Finding a life partner who understands and supports your professional ambitions isn\'t easy, but SPMO Matrimony made it possible. The site\'s focus on matching based on career goals and personal interests set it apart. We found our perfect match, and the journey has been incredible!\\\"<\\/em><br \\/><\\/p>\"}', '2024-08-21 11:07:05', '2024-08-21 11:07:05'),
(261, 93, 1, '{\"name\":\"Kumar Motwani\",\"relation\":\"Father\",\"description\":\"<p><strong>Neha &amp; Vikram: Love Beyond Boundaries<\\/strong>\\n<\\/p><p><em>\\\"SPMO Matrimony helped us find love across different cities, something we thought would be impossible. The detailed profiles and genuine connections made all the difference. We\'re now happily married and building a life together, despite the distance!\\\"<\\/em><br \\/><\\/p>\"}', '2024-08-21 11:08:12', '2024-08-21 11:08:12'),
(262, 94, 1, '{\"name\":\"Sunil Keswani\",\"relation\":\"Father\",\"description\":\"<p><strong>Rhea &amp; Sanjay: A Strong Foundation<\\/strong><\\/p><p>\\n<em>\\\"Trust and compatibility were our top priorities, and SPMO Matrimony delivered. The platform\'s emphasis on finding partners who share similar values and goals made it easy to connect with someone special. We\'re grateful for the strong foundation this site helped us build!\\\"<\\/em><br \\/><\\/p>\"}', '2024-08-21 11:08:45', '2024-08-21 11:08:45');
