INSERT INTO `templates` (`id`, `language_id`, `section_name`, `description`, `created_at`, `updated_at`) VALUES
(1, 1, 'hero', '{\"title\":\"Find your perfect soul mate!\",\"sub_title\":\"Bringing Soulmates Together, Building Strong Foundations for a Future Full of Love and Happiness\",\"button_name\":\"discover more\"}', '2021-12-17 10:02:59', '2024-09-04 12:24:39'),
(3, 1, 'about-us', '{\"title\":\"About Us\",\"short_description\":\"<h3><\\/h3><p>Welcome to SPMO, where love and meaningful connections are our priority. Our mission is to help you find a partner who shares your values and aspirations.<\\/p><h4>Our Story<\\/h4><h3><\\/h3><p>SPMO was created to provide a platform for individuals to meet, connect, and build lasting relationships. We know that finding a life partner is one of the most important decisions you\'ll make, and we\'re here to support you on that journey.<\\/p><p>Our experienced team blends advanced technology with a personal touch, focusing on meaningful connections rather than superficial matches.<\\/p><h4>What Sets Us Apart<\\/h4><h3><\\/h3><p>At SPMO, we connect individuals who share core values and life goals, fostering deep and compatible relationships. Our platform is designed to help you find a partner who truly aligns with your vision.<\\/p><p>We offer personalized services to guide you through every step of your search, while prioritizing your privacy and security.<\\/p><h4>Our Values<\\/h4><h3><\\/h3><ul><li><strong>Integrity<\\/strong>: Honesty and transparency in everything we do.<\\/li><li><strong>Respect<\\/strong>: A respectful, inclusive community where everyone is valued.<\\/li><li><strong>Commitment<\\/strong>: Dedicated to helping you find a lasting relationship.<\\/li><li><strong>Innovation<\\/strong>: Using the latest technology to enhance your search experience.<\\/li><\\/ul><h4>Join Us<\\/h4><h3><\\/h3><p>SPMO is more than a matrimony site \\u2013 it\'s a community built on the belief that love is the foundation of happiness. Whether you\'re ready to find your life partner or just beginning your search, we\'re here to help. Join us today and start your journey to finding true love.<\\/p><p>Welcome to SPMO \\u2013 where your journey to happiness begins.<\\/p>\"}', '2021-12-17 10:02:59', '2024-08-23 13:55:53'),
